import React from 'react'
import '../styles/Components.css'

const Dropdown = ({className, value, onChange, options, defaultOption }) => {
    return (
        <div className={`dropdown dd-com`}>
            <div className={`dropdown-toggle ${className}`} role="button" data-bs-toggle="dropdown" aria-expanded="false">
                {value}
            </div>
            <div className="dropdown-menu dd-menu">
                <div onClick={onChange} data-value="Select State" className="dropdown-item state-item">{defaultOption}</div>
                {options.map((element)=>{
                    return <div onClick={onChange} data-value={element}>{element}</div>
                })}
            </div>
        </div>
    )
}

export default Dropdown
